import { useState } from "react";
import EmloyeeItem from "./EmployeeItem";
import "./EmployeesList.css";

const data = [
  {
    id: "1",
    f_name: "Gil",
    l_name: "Hatav",
    email: "gil.hatav@gmail.com",
  },
  {
    id: "2",
    f_name: "koko",
    l_name: "KooKoo",
    email: "koko@walla.com",
  },
  {
    id: "3",
    f_name: "Moshe",
    l_name: "Cohen",
    email: "moshe.c@gmail.com",
  },
];

const API = "http://localhost:8080/api/employee";

function EmployeesList(props) {
  const [employees, setEmployees] = useState(data);

  //Functions
  const getAllEmployees = () => {
    console.log("here");
    fetch(API,  {
      method: "GET",
      
      
   })
   .then((response) => {
       console.log(response);
       try {
           console.log(JSON.parse(response))
       }
       catch(err){
           console.log("parsing err ",err)
       }
  })
  .catch((err)=>{
      console.log("err ",err)
  });
  };

  getAllEmployees();

  return (
    <div>
      <table className="content-table">
        <thead>
          <tr>
            <th>id</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Update</th>
          </tr>
        </thead>
        <tbody>
          {employees.map((employee) => (
            <EmloyeeItem
              key={employee.id}
              id={employee.id}
              f_name={employee.f_name}
              l_name={employee.l_name}
              email={employee.email}
            />
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default EmployeesList;
